АО “ХСЗ” обладает собственной лабораторией аттестованной Госстандартом России и Морским Регистром Судоходства. Лаборатория осуществляет контроль качества всех судостроительных материалов, покрытий, сварных соединений, механические испытания образцов и сварных изделий.

АО “ХСЗ” выполняет работы по постройке, переоборудованию, модернизации и ремонту судов, а также осуществляет:

гальваническое производство;
термическую обработку металла;
трубообрабатывающее производство;
безразметочную резку различных металлов до б=120мм;
сварочные работы любой сложности;
изготовление металлоконструкций и нестандартного; оборудования.

АО «НТЦ «РИФ» основано в 2008 году.
Основными направлениями деятельности АО «НТЦ «РИФ» являются разработка и изготовление:
электронных модулей и периферийных устройств;
автоматизированных систем управления;
специализированных тренажерно-обучающих комплексов;
систем электропитания и электроснабжения;
аппаратно-программных комплексов сбора, анализа и обработки данных.
АО «НТЦ «РИФ» решает сложные технические задачи от разработки концепции до воплощения их в серийные изделия. В процессе реализации проектов используется системный подход в решении научно-технических задач для создания систем широкого назначения.
За время работы коллектива создана школа опытных инженеров, работает команда компетентных, высококвалифицированных научных и инженерных кадров, экспертов проблемной области, поддерживается идеология комплексного подхода и системной разработки продукции для обеспечения ее высокого качества и требуемого уровня надежности на базе применения международных стандартов.
На территории АО «НТЦ «РИФ» организована сертифицированная испытательная лаборатория (климатические камеры, камера влажности, вибростенд, пробойные установки и т. д.), позволяющая организовать полный цикл испытаний производимой продукции.
